import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className = 'TitleBar'>
          <img src="./images/antiantimage.png" alt="No Antimage"/> 
          <div className = 'TitleText'>
            The Anti-AntiMage App: AntiMage = Anti-Fun
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
